import React from 'react';
import { Button, Checkbox, Form, Input, Space } from 'antd';

const LoginForm = () => {

    const onFinish = (values)=>{
        console.log('Success: ', values);
    }

    const onFinishFailed = (error)=>{
        console.log('Failed: ', error);
    }

   return(
    <Space>
    <Form onFinish={onFinish} onFinishFailed={onFinishFailed} className='loginForm'>
        <Form.Item className='loginFormImput' label="Username" name="username" rules={[{required: true, message: 'Please Enter the username!'}]}>
            <Input />
        </Form.Item>
        <Form.Item className='loginFormImput' label="Password" name="password" rules={[{required: true, message: 'Please enter the password!'}]}>
            <Input />
        </Form.Item>
        <Form.Item>
            <Checkbox>Remember Me</Checkbox>
        </Form.Item>
        <Form.Item>
            <Button type='primary' htmlType='submit'>Login</Button>
        </Form.Item>
    </Form>
    </Space>
   ) 
}

export default LoginForm;
